    { id: 1, message: "Lets fire", likeCount: "10" },
    { id: 2, message: "U smell like sheep", likeCount: "7" },
    { id: 3, message: "Hi bro", likeCount: "2" },
  ];

  let postsElements = postData.map((p) => (
    <Post likeCount={p.likeCount} message={p.message} />
  ));

  return (
    <div className={classes.posts}>
      <div className={classes.area}>
        <textarea></textarea>
        <br />
        <button>Add</button>
        <button>Clear</button>
      </div>
      <div className={classes.postsItem}>
        <h2>My posts</h2>
        {postsElements}
      </div>
    </div>
  );
}
export default Posts;
